if (typeof window["TW2Pro"] == "undefined") {


    global_functions();
    strings();

    var loader = setInterval(function() {
        if (document.body != null) {
            window.clearInterval(loader);
            if (typeof EventHandler != "undefined") {
                TW2Pro.MenuBlinker = function(type) {
                    if (typeof TW2Pro.Menu == "undefined") {
                        if (type == "messages") {
                            sessionStorage.setItem("TW2Pro_blinker_messages", "true");
                        };
                        if (type == "reports") {
                            sessionStorage.setItem("TW2Pro_blinker_reports", "true");
                        };
                        if (type == "townforum") {
                            sessionStorage.setItem("TW2Pro_blinker_townforum", "true");
                        };
                    } else {
                        if (type == "messages") {
                            TW2Pro.Menu.start_blinker("telegrams_button", telegrams_button_mask);
                        };
                        if (type == "reports") {
                            TW2Pro.Menu.start_blinker("reports_button", reports_button_mask);
                        };
                        if (type == "townforum") {
                            TW2Pro.Menu.start_blinker("townforum_button", townforum_button_mask);
                        };
                    };
                };
                EventHandler.listen("player-toread-messages", function() {
                    TW2Pro.MenuBlinker("messages");
                });
                EventHandler.listen("player-toread-reports", function() {
                    TW2Pro.MenuBlinker("reports");
                });
                EventHandler.listen("player-toread-townforum", function() {
                    TW2Pro.MenuBlinker("townforum");
                });
            };
            TW2Pro.injectLoader();
        };
    }, 10);


    TW2Pro.injectCore = function() {
        if (~document.location.toString().indexOf("game.php")) {
            var loader_delay = setInterval(function() {
                if (!document.getElementsByClassName("linear_quest")[0]) {
                    if (QuestTrackerWindow) {
                        if (typeof QuestTrackerWindow.window != "undefined") {
                            window.clearInterval(loader_delay);
                            TW2Pro.injectLoader(true);
                            setTimeout(function() {
                                styles();
                            }, 1);
                            setTimeout(function() {
                                core();
                            }, 2);
                            setTimeout(function() {
                                window_playerprofile();
                            }, 3);
                            setTimeout(function() {
                                window_fortoverview();
                            }, 4);
                            setTimeout(function() {
                                window_townoverview();
                            }, 5);
                            setTimeout(function() {
                                window_wear();
                            }, 6);
                            setTimeout(function() {
                                window_with_all_players();
                            }, 7);
                            setTimeout(function() {
                                window_report_open();
                            }, 8);
                            TheWestApi.register("tw2pro", "TW2Pro", "2.10.0", "10.00.0", "Jaroslav Jursa", "https://forum.the-west.sk/index.php?threads/tw2pro.22238/").setGui("TW2Pro beta v" + TW2Pro.version + "<br><br>Thank you for using TW2Pro. <b>Developing discontinued.</b><br><br>search best items for:<br><a onclick='TW2Pro.searchBest(0)'>range dueler, attacker</a><br><a onclick='TW2Pro.searchBest(1)'>range dueler, defender</a><br><a onclick='TW2Pro.searchBest(2)'>melee dueler</a><br><a onclick='TW2Pro.searchBest(3)'>health</a><br><a onclick='TW2Pro.searchBest(4)'>fortbattle, attacker</a><br><a onclick='TW2Pro.searchBest(5)'>fortbattle, defender</a><br><a onclick='TW2Pro.searchBest(6)'>construction</a><br><br>utilities:<br><a onclick='TW2Pro.reportOpen()'>open report</a><br><a onclick='TW2Pro.window_with_all_players.show()'>send telegram to all players</a><br><a onclick='TWDB.ClothCalc.open()'>open TWDB cloth calc</a><br><br><br>MIT License, Copyright (c) 2014-2019 Jaroslav Jursa (Blood Killer)");
                        };
                    };
                } else {
                    window.clearInterval(loader_delay);
                    TW2Pro.injectLoader(true);
                    new MessageError(tw2pro_string_8).show();
                };
            }, 10);
        } else {
            TW2Pro.injectLoader(true);
        };
    };


    TW2Pro.injectAll = function() {
        setTimeout(function() {
            TW2Pro.injectCore();
            if (typeof Registration != "undefined" && !~document.location.toString().indexOf("tw2pro=get_count")) {
                setTimeout(function() {
                    styles();
                }, 1);
                setTimeout(function() {
                    login_page();
                }, 2);
            };
            //if(~document.location.toString().indexOf("tw2pro=get_count")){
            //setTimeout(function(){players_count();}, 1);
            //};
        }, 0);
    };

    if (document.readyState === "complete") {
        TW2Pro.injectAll();
    } else {
        window.addEventListener("load", function() {
            TW2Pro.injectAll();
            //setTimeout(function(){$.getScript("http://tw2pro.eu/update.js?"+TW2Pro.random(0, 9999));}, 2000);
        }, false);
    };

    //window.ondragstart = function(){return false;};


};

